import React, { useState } from "react";
import "./newExpense.css";
import ExpenseForm from "../ExpenseForm/expenseForm";
const NewExpense = (newExp) => {
  const SaveNewExpenseHandler = (EnteredExpenseData) => {
    const NewExpenseData = {
      ...EnteredExpenseData,
      id: Math.random().toString(),
    };
    newExp.onNewExpense(NewExpenseData);
  };

  const buttonAdd = <button onClick={changeButtonTask}>Add New Expense</button>;
  const [buttonTask, changebuttonTask] = useState(buttonAdd);
  const ChangeButtonTask = (task) => {};

  return (
    <div className="new-expense">
      <ExpenseForm onSaveNewExpense={SaveNewExpenseHandler} />
    </div>
  );
};
export default NewExpense;
